import logo from './logo.svg';
import './App.css';
import Home from './pages/home'
import logoImage from './4life.svg';
import React from 'react';
import { Route, Switch, Link, Router, Routes} from 'react-router-dom';

import MyMentee from './MyMentee';
import Mentee from './Mentee';


function App() {
  return(
    <Router>
      <Routes>
        <Route path="/" elemnts = {Home}/>
        <Route path='/mentee' elements = {Mentee}/> 
      </Routes>
      </Router>
  )
}
export default App;
